import Menu from './Menu.js';
import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
    return(
        <div id='header'>
            <button component={Link} to="/new/location/">
                Logo
            </button>
            <Menu />
        </div>
    )
}

export default Header;
